
async function generatePDF() {
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF();
    
    // Configuración inicial del documento
    doc.setFont("Poppins", "normal");
    const pageWidth = doc.internal.pageSize.getWidth();
    const marginX = 20;
    let y = 20;
    
    
    // Agrega un logo (opcional)
    // // Agrega tu imagen en formato Base64 aquí.
    const logo = "data:image/jpeg;base64,"; 
    
    //doc.addImage(logo, "PNG", marginX, 10, 30, 30); // Posición y tamaño del logo.
    doc.addImage(logo, "PNG", marginX, 10, 30, 30); // Tamaño reducido (30x30)
    y += 15; // Aumenta el espacio después del logo
    
    // Título principal con estilo
    doc.setFontSize(22);
    doc.setFont("Poppins", "bold");
    doc.setTextColor("#7E643B");
    doc.text("Resumen de Pedido", pageWidth / 2, y, { align: "center" });
    y += 10;
    
    // Línea divisoria
    doc.setDrawColor(126, 100, 59);
    doc.line(marginX, y, pageWidth - marginX, y);
    y += 10;
    
    // Información de folio
    const folioValue = document.getElementById("folio").value;
    doc.setFontSize(16);
    doc.setTextColor("#333");
    doc.text("Pedido con folio:", marginX, y);
    doc.setTextColor("#af2424");
    doc.text(folioValue, marginX + 50, y);
    y += 10;
    
    // Líneas divisorias entre secciones
    doc.setDrawColor(200, 200, 200);
    doc.line(marginX, y, pageWidth - marginX, y);
    y += 10;
    
    // Información detallada
    const labels = document.querySelectorAll("label");
    const inputs = document.querySelectorAll("input");
    
    labels.forEach((label, index) => {
        // Añade cada etiqueta e input
        if (index % 2 === 0 && index > 0) y += 10; // Cambiar fila cada 2 columnas
        const columnX = index % 2 === 0 ? marginX : pageWidth / 2;
        const textX = columnX + 50;
    
        // Etiqueta
        doc.setFontSize(12);
        doc.setFont("Poppins", "bold");
        doc.setTextColor("#7A5A23");
        doc.text(label.textContent, columnX, y);
    
        // Valor del input
        doc.setFontSize(12);
        doc.setFont("Poppins", "normal");
        doc.setTextColor("#000");
        doc.text(inputs[index].value, textX, y);
    });
    
    y += 15;
    
    // Agrega un botón decorativo
    doc.setFillColor(251, 175, 53);
    doc.rect(marginX, y, pageWidth - marginX * 2, 10, "F");
    doc.setTextColor("#FFF");
    doc.setFontSize(12);
    doc.text("Gracias por tu preferencia", pageWidth / 2, y + 7, { align: "center" });
    
    // Guardar el archivo
    doc.save("Resumen_detallado_HEC.pdf");
    }
    
    // Asignar la función al botón
    document.querySelector(".descargarPDF-button").addEventListener("click", generatePDF);
    
    
    
    